import React, { Component } from 'react'

export default class editablecellselect extends Component {
    render() {
        let values=this.props.cellData.value;
        console.log(values)
        let options=values.map((val) => 
            <option value={val}>{val}</option>
            );
        return (
            <td>
                <select name={this.props.cellData.type} id={this.props.cellData.id} onChange={this.props.onProductTableUpdate} style={{width:'100%'}} >
                    {options}
                </select>
            </td>
        )
    }
}
